import React, { useState, useEffect } from 'react';

const LaunchDetails = ({ launch }) => {
    const [rocket, setRocket] = useState(null);
    const [launchPad, setLaunchPad] = useState(null);

    useEffect(() => {
      fetch(`https://api.spacexdata.com/v4/rockets/${launch.rocket}`)
        .then(response => response.json())
        .then(data => setRocket(data))
        .catch(error => console.error('Error fetching rocket details:', error));

      fetch(`https://api.spacexdata.com/v4/launchpads/${launch.launchpad}`)
        .then(response => response.json())
        .then(data => setLaunchPad(data))
        .catch(error => console.error('Error fetching launch pad details:', error));
    }, [launch]);

    return (
      <div>
        <h2>Launch Details</h2>
        <p>Name: {launch.name}</p>
        <p>Details: {launch.details}</p>
        <p>Success Rate: {launch.success_rate_pct}%</p>
        <p>Upcoming: {launch.upcoming ? 'Yes' : 'No'}</p>
        <p>Launch Date: {launch.date_utc}</p>
        <img src={launch.links.patch.small} alt="Launch Patch" />
        <p>Rocket Mass: {rocket.mass?.kg} kg</p>
          <p>Rocket Name: {rocket.rocket_name}</p>
          <p>Rocket Description: {rocket.description}</p>
          {rocket.flickr_images && (
            <div>
              <h3>Rocket Picture</h3>
              {rocket.flickr_images.map(imageUrl => (
                <img key={imageUrl} src={imageUrl} alt="Rocket" />
              ))}
            </div>
          )}
        <p>Launch Pad Coordinates: {launchPad && `${launchPad.latitude}, ${launchPad.longitude}`}</p>
        {/* Embed YouTube video here */}
        {rocket && <p>Rocket Name: {rocket.name}</p>}
        {/* Other rocket details */}
      </div>
    );
  };

  export default LaunchDetails;
